import { View, Text } from 'react-native'
import React from 'react'
import HeaderTabs from './HeaderTabs'
import { SafeAreaView } from 'react-native-web'

export default function BuyerMain() {
  return (
    <SafeAreaView>
      <View>
        <HeaderTabs/>
      </View>
    </SafeAreaView>
  )
}
